(function() {
  jQuery(function() {
    var as_currency, calculate_discount, clear_coupon_badge, set_coupon_badge, toggle_coupon_divs, update_totals, validate_coupon;
    toggle_coupon_divs = function(element) {
      $("#valid_coupon").hide();
      $("#invalid_coupon").hide();
      $("#processing_coupon").hide();
      return $(element).show();
    };
    set_coupon_badge = function(status) {
      var css_icon, css_style, text;
      switch (status) {
        case 'error':
          css_style = 'danger';
          css_icon = 'remove';
          text = 'Invalid Coupon';
          break;
        case 'success':
          css_style = 'success';
          css_icon = 'ok';
          text = 'Valid Coupon';
          break;
        case 'processing':
          css_style = 'info';
          css_icon = 'time';
          text = 'Validating coupon';
      }
      return $("#payment-coupon-div .help-block").html('<span class="label label-' + css_style + '"><span class="glyphicon glyphicon-' + css_icon + '"></span> ' + text + '</span>');
    };
    clear_coupon_badge = function(element) {
      return $("#payment-coupon-div .help-block").html('');
    };
    calculate_discount = function(price, discount, type) {
      var ret;
      if (discount === 0) {
        ret = [price, 0, price];
      } else {
        ret = [price, price - discount, discount];
      }
      return ret;
    };
    as_currency = function(value) {
      return "$" + parseFloat(value, 10).toFixed(2);
    };
    update_totals = function(amounts) {
      $("#td_appraisal_cost").text(as_currency(amounts[0]));
      $("#td_appraisal_discount").text(as_currency(amounts[1]));
      return $("#td_appraisal_total").text(as_currency(amounts[2]));
    };
    validate_coupon = function(params) {
      return $.ajax("/validate_coupon", {
        type: 'GET',
        dataType: 'json',
        data: {
          coupon_code: $("#appraisal_payment_attributes_coupon").val(),
          appraisal_type: $("#appraisal_type").val(),
          customer_id: $("#customer_id").val(),
          is_xw: $("#processXW").is(":checked")
        },
        success: function(data) {
          set_coupon_badge('success');
          return update_totals(calculate_discount($("#appraisal_price").val(), data.discount, data.discount_type));
        },
        error: function(data) {
          set_coupon_badge('error');
          return update_totals(calculate_discount($("#appraisal_price").val(), 0, "fixed"));
        }
      });
    };
    $("#appraisal_payment_attributes_coupon").keyup(function() {
      if ($("#appraisal_payment_attributes_coupon").val().length !== 16) {
        clear_coupon_badge();
        update_totals(calculate_discount($("#appraisal_price").val(), 0, "fixed"));
        return false;
      } else {
        set_coupon_badge('processing');
        return validate_coupon();
      }
    });
    clear_coupon_badge();
    $("#appraisal_payment_attributes_coupon").keyup();
    return $("#processXW").change(function() {
      if ($("#appraisal_payment_attributes_coupon").val().length !== 16) {
        clear_coupon_badge();
        update_totals(calculate_discount($("#appraisal_price").val(), 0, "fixed"));
        return false;
      } else {
        set_coupon_badge('processing');
        return validate_coupon();
      }
    });
  });

}).call(this);
